import './App.css';
import { filterData,apiUrl } from './data';

import Navbar from './components/Navbar';
import Cards from './components/Cards';
import Filter from './components/Filter';

let App=() =>{

  return (
    <div>
      <Navbar/>
      <Filter
        filterData={filterData}
      />
      <Cards/>
    </div>
  ) 
}

export default App;
